import {StyleSheet} from 'react-native';

const commonStyles = StyleSheet.create({
    compContainer:{
        flex: 1,
        backgroundColor: '#fff',
        justifyContent: 'center',
        alignItems: 'center',
    },
    mainContainer:{
        width: '100%',
        height: '100%',
        backgroundColor: 'rgba(0, 0, 0, 0.3)',
        justifyContent: 'center',
        alignItems: 'center'
    }
})

export default commonStyles;
